import React, { useState } from 'react'
import theHarvesterOutput from '../theHarvesterOutput.json'

export default function PTtable(){
    const [data, setdata] = useState(theHarvesterOutput)
    return(
        <div>
            <table>
                <thead>
                    <th>      
                        asset
                    </th>
                    <th>
                        IP address
                    </th>
                </thead>
                <tbody>
                    {
                        data.map((d)=>(
                            <tr key={d.asset} >
                                <td>
                                    {d.asset}
                                </td>
                                <td>
                                    {d.IP_Address}
                                </td>

                            </tr>
                        ))
                    }

                </tbody>
            </table>
            
        
        </div>
    )
}
